objetoCompra:
Aquisição de extintores de incêndio novos, com carga extintora PQS ABC de validade de 5 anos da data da compra, certificação do Inmetro e fabricação conforme NBR 15808, incluindo suportes metálicos, suportes veiculares e, quando aplicável, placa de sinalização fotoluminescente. O objeto contempla:
– 23 Extintores ABC 8 kg, capacidade mínima 2-A:20-B:C, com suporte de parede e placa de sinalização;
– 1 Extintores ABC 4 kg para veículo, capacidade mínima 2-A:20-B:C, com suporte veicular;
– 2 Extintores ABC 2 kg, capacidade mínima 1-A:5-B:C, com suporte veicular;
– 11 Extintores ABC 1 kg, capacidade mínima 1-A:5-B:C, com suporte veicular.
Os equipamentos destinam-se às instalações físicas e à frota oficial da CR-BTO e UTLs Subordinadas.
